description:
It's Alive (2008)  

Verenigde Staten
Horror
84 minuten

geregisseerd door Josef Rusnak
met Bijou Phillips, Skye Bennett en Arkie Reece

Een jong stel krijgt een baby, maar ontdekt al snel na de geboorte dat de baby niet zomaar een baby is. Het kleine kindje blijkt een gruwelijk monster te zijn, dat op bijzondere wijze mensen kan vermoorden.

